import Photos from "../../../assets/Photos.jsx";
const service = [
    {
        img:"https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcQX9szcGz9LG3j0xpbafC9_JI7If98J_zhGGw&s",
        title:"Оперативні транспортні перевезення",
        description:"Які не вимагають спеціального температурного режиму і вага " +
            "і обсяг, яких не перевищує можливої вантажопідйомності автотранспорту."
    },
    {
        img:Photos.photo.service_22,
        title:"Перевезення небезпечних вантажів",
        description:"Найпоширеніше маркування небезпечних вантажів - «ADR». Вантажі " +
            "небезпечних категорій в обов'язковому порядку страхуються на випадок форс-мажорних" +
            " обставин."
    }
]

export default service;
